import './App.css';
import { Flex, FormLabel, FormControl } from "@chakra-ui/react"

function App() {
  return (
    <Flex>
      <FormControl id="email">
        <FormLabel>Email address</FormLabel>
        <Input type="email" />
        <FormHelperText>We'll never share your email.</FormHelperText>
      </FormControl></Flex>
  );
}

export default App;
